import React from 'react';
import PropTypes from 'prop-types';

import '../../style/main.scss';
import './Header.css';

const Header = ({ headLine }) => (
  <div className="box">
    <h1 className="headLine"> { headLine } </h1>
  </div>
);

Header.propTypes = {
  headLine: PropTypes.node,
};

Header.defaultProps = {
  headLine: '',
};

export default Header;
